import React from 'react'
import './App.css';
import Navbar from './components/NavBar';

function App() {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavLogo>
            Facial Expression
          </NavLogo>
        </NavbarContainer>
      </Nav>
    </>
  );
}

export default App;
